import logo from '../icons/logo.svg'
import notification from "../icons/notification.svg"
export const navbarData = [
    {
        title: "logo",
        icon: logo,
        link: "/home"
    },
    {
        title: "notification",
        icon: notification,
        link: "/notification"
    }
]
